const PTM = 100;
const INV_PTM = 1 / PTM;
const PI = Math.PI;

class AABBIntersection {
    _bodies = [];
    _handleMap = new Map();
    _mouse;
    _mouseShape;
    _intersected = [];
    _p = CA.new(0, 0);
    _cb;
    _cfg = {
        queryFirstOnly: false,
        currentCount: 0
    };
    _onlyFirstInput;
    _curCountMonitor;
    init(context) {
        const left = 1;
        const top = 1;
        for (let i = 0; i < 7; i++) {
            for (let j = 0; j < 7; j++) {
                const rnd = Math.random();
                const body = (rnd > .5 ? context.createBall(.2, 0, 0, left + i, top + j, IA.Static) : context.createCuboid(.2, .2, 0, 0, 0, left + i, top + j, IA.Static));
                this._bodies.push(body);
                this._handleMap.set(body.handle, body);
            }
        }
        this._mouse = context.createCuboid(0.7, 0.7, 0, 0, 0, 0, 0, IA.KinematicPositionBased);
        this._mouseShape = context.world.getCollider(this._mouse.collider(0));
        const scene = context.renderingScene;
        scene.input.on(Phaser.Input.Events.POINTER_MOVE, this.onMouseMove, this);
        this._cb = this.aabbCallback.bind(this);
        this._onlyFirstInput = context.getDebugPane().addInput(this._cfg, 'queryFirstOnly', { type: 'checkbox' });
        this._curCountMonitor = context.getDebugPane().addMonitor(this._cfg, 'currentCount', { type: 'text' });
    }
    onMouseMove(e) {
        this._p.x = e.worldX * INV_PTM;
        this._p.y = e.worldY * INV_PTM;
        this._mouse.setTranslation(this._p, true);
    }
    update(context, time, delta) {
        this._intersected.length = 0;
        context.world.collidersWithAabbIntersectingAabb(this._mouse.translation(), this._mouseShape.halfExtents(), this._cb);
        this._cfg.currentCount = this._intersected.length;
    }
    aabbCallback(handle) {
        const body = this._handleMap.get(handle);
        if (!body)
            throw new Error("??");
        this._intersected.push(body);
        return !this._cfg.queryFirstOnly;
    }
    draw(drawer) {
        const len = this._intersected.length;
        for (let i = 0; i < len; i++) {
            const o = this._intersected[i];
            drawer.drawBody(o, { static: { color: 0xff0000 } });
        }
    }
    destroy(context) {
        context.renderingScene.input.off(Phaser.Input.Events.POINTER_MOVE, this.onMouseMove, this);
        context.world.removeRigidBody(this._mouse);
        this._bodies.forEach(b => {
            context.world.removeRigidBody(b);
        });
        this._bodies = [];
        context.getDebugPane().remove(this._curCountMonitor);
        context.getDebugPane().remove(this._onlyFirstInput);
    }
}

class ManyBoxes {
    _cfg = {
        angularVelocity: 0.2,
        boardWidth: 4.5,
        boardHeight: .15,
        circleRaius: .3,
        circleMargin: 1.3,
        boxSize: 0.1,
        boxCount: 700
    };
    _created = [];
    add(o) {
        this._created.push(o);
    }
    init(context) {
        const cfg = this._cfg;
        const cx = 4;
        const cy = 4;
        const staticCenterBody = context.createBody(IA.Static);
        const tumblerBox = context.createBody(IA.Dynamic);
        const ballJointParam = UA.revolute(CA.new(cx, cy), CA.new(cx, cy));
        const ballJoint = context.world.createImpulseJoint(ballJointParam, staticCenterBody, tumblerBox);
        ballJoint.configureMotorVelocity(cfg.angularVelocity, cfg.angularVelocity);
        const bwHalf = cfg.boardWidth * .5;
        const bhHalf = cfg.boardHeight * .5;
        context.createCuboid(bhHalf, bwHalf, 0, bwHalf + cx, cy, 0, 0, tumblerBox);
        context.createCuboid(bhHalf, bwHalf, 0, cx - bwHalf, cy, 0, 0, tumblerBox);
        context.createCuboid(bwHalf, bhHalf, 0, cx, cy + bwHalf, 0, 0, tumblerBox);
        context.createCuboid(bwHalf, bhHalf, 0, cx, cy - bwHalf, 0, 0, tumblerBox);
        const radius = cfg.circleRaius;
        const bcx = cfg.circleMargin;
        const bcy = cfg.circleMargin;
        context.createBall(radius, cx + bcx, cy + bcy, 0, 0, tumblerBox);
        context.createBall(radius, cx - bcx, cy + bcy, 0, 0, tumblerBox);
        context.createBall(radius, cx - bcx, cy - bcy, 0, 0, tumblerBox);
        context.createBall(radius, cx + bcx, cy - bcy, 0, 0, tumblerBox);
        this.add(staticCenterBody);
        this.add(tumblerBox);
        this.add(ballJoint);
        const halfSize = cfg.boxSize * .5;
        const borderRange = cfg.boardWidth * .25 - .3;
        let nx = -borderRange;
        let ny = -borderRange;
        let count = 0;
        while (count < cfg.boxCount) {
            nx += halfSize + .01;
            if (nx > borderRange) {
                ny += halfSize + .01;
                nx = -borderRange;
            }
            this.add(context.createCuboid(halfSize, halfSize, 0, cx * .5 + nx, cy * .5 + ny, cx * .5 + nx, cy * .5 + ny, IA.Dynamic));
            count++;
        }
    }
    update() {
    }
    destroy(context) {
        this._created.forEach(e => {
            if (e instanceof iA)
                context.world.removeRigidBody(e);
            else if (e instanceof vA)
                context.world.removeCollider(e, false);
            else if (e instanceof aA)
                context.world.removeImpulseJoint(e, false);
        });
        this._created = [];
    }
}

// RUBE is an IDE for creating Box2D world, here i just parse what i need from the json it exports
const RUBELoader = {
    async loadJson(url) {
        const ret = await fetch(url);
        return ret.json();
    },
    parseJsonToBodyDesc(data) {
        if (!data.body)
            throw new Error("Invalid json");
        const ret = [];
        for (let i = 0; i < data.body.length; i++) {
            const body = data.body[i];
            let bodyType = 0;
            switch (body.type) {
                case 0:
                    bodyType = IA.Static;
                    break;
                case 1:
                    bodyType = IA.KinematicVelocityBased;
                    break;
                case 2:
                    bodyType = IA.Dynamic;
                    break;
                default:
                    throw new Error("Unknown body type");
            }
            const bodyDesc = new DA(bodyType);
            if (typeof body.position === 'object') // circle does not have position in RUBE
                bodyDesc.setTranslation(body.position.x, body.position.y);
            bodyDesc.setRotation(body.angle);
            const fxs = body.fixture;
            let colliders = [];
            for (let i = 0; i < fxs.length; i++) {
                const fx = fxs[i];
                if ('chain' in fx) {
                    const chain = fx.chain;
                    const vs = new Float32Array(chain.vertices.x.length * 2);
                    for (let n = 0; n < chain.vertices.x.length; n++) {
                        vs[n * 2] = chain.vertices.x[n];
                        vs[n * 2 + 1] = chain.vertices.y[n];
                    }
                    colliders.push(PA.polyline(vs, null));
                }
                else if ('polygon' in fx) {
                    const polygon = fx.polygon;
                    const vs = new Float32Array(polygon.vertices.x.length * 2);
                    for (let n = 0; n < polygon.vertices.x.length; n++) {
                        vs[n * 2] = polygon.vertices.x[n];
                        vs[n * 2 + 1] = polygon.vertices.y[n];
                    }
                    colliders.push(PA.convexHull(vs));
                }
                else if ('circle' in fx) {
                    const circle = fx.circle;
                    const d = PA.ball(circle.radius);
                    d.setTranslation(circle.center.x, circle.center.y);
                    colliders.push(d);
                }
            }
            ret.push({
                desc: bodyDesc,
                colliders
            });
        }
        return ret;
    }
};

class RayCast {
    _cfg = {
        numRays: 100,
        maxTOI: 10,
        solidCast: true,
        showNormal: true
    };
    _changeTimeout = NaN;
    _rays = [];
    _bodies = [];
    _center = CA.new(4, 4);
    _rayAngle = 0;
    _tempV2 = CA.new(0, 0);
    _debugBindings = [];
    async init(context) {
        context.getDebugPane().disabled = true; // can't operate during loading json
        const json = await RUBELoader.loadJson('./json/test_raycast.json');
        const descs = RUBELoader.parseJsonToBodyDesc(json);
        descs.forEach(desc => {
            const body = context.world.createRigidBody(desc.desc);
            desc.colliders.forEach(c => {
                context.world.createCollider(c, body.handle);
            });
            this._bodies.push(body);
        });
        const numSlider = context.getDebugPane().addInput(this._cfg, 'numRays', { min: 10, max: 1000, step: 10 });
        numSlider.on('change', handler => {
            clearTimeout(this._changeTimeout);
            this._changeTimeout = window.setTimeout(() => {
                this._cfg.numRays = handler.value;
                this.genRays();
            }, 1000);
        });
        this._debugBindings.push(numSlider);
        const toiSlider = context.getDebugPane().addInput(this._cfg, 'maxTOI', { min: 1, max: 10, step: 1 });
        this._debugBindings.push(toiSlider);
        const solidCKBox = context.getDebugPane().addInput(this._cfg, 'solidCast', { type: 'checkbox' });
        this._debugBindings.push(solidCKBox);
        const showNormal = context.getDebugPane().addInput(this._cfg, 'showNormal', { type: 'checkbox' });
        this._debugBindings.push(showNormal);
        this.genRays();
        // enable after loading
        context.getDebugPane().disabled = false;
    }
    genRays() {
        if (this._rays.length === this._cfg.numRays)
            return;
        if (this._rays.length <= 0) {
            const num = this._cfg.numRays;
            for (let i = 0; i < num; i++) {
                this._rays.push({
                    ray: new _A(CA.zeros(), CA.new(1, 0)),
                    ret: null
                });
            }
        }
        else if (this._rays.length > this._cfg.numRays)
            this._rays.length = this._cfg.numRays;
        else if (this._rays.length < this._cfg.numRays) {
            const num = this._cfg.numRays - this._rays.length;
            for (let i = 0; i < num; i++) {
                this._rays.push({
                    ray: new _A(CA.zeros(), CA.new(1, 0)),
                    ret: null
                });
            }
        }
    }
    update(context, time, delta) {
        this._rayAngle += 0.001;
        const len = this._rays.length;
        const step = Phaser.Math.DegToRad(360 / len);
        const showNormal = this._cfg.showNormal;
        for (let i = 0; i < len; i++) {
            const rayObj = this._rays[i];
            rayObj.ray.origin.x = this._center.x;
            rayObj.ray.origin.y = this._center.y;
            rayObj.ray.dir.x = Math.cos(this._rayAngle + i * step);
            rayObj.ray.dir.y = Math.sin(this._rayAngle + i * step);
            if (showNormal)
                rayObj.ret = context.world.castRayAndGetNormal(rayObj.ray, this._cfg.maxTOI, this._cfg.solidCast, 0xffffff);
            else
                rayObj.ret = context.world.castRay(rayObj.ray, this._cfg.maxTOI, this._cfg.solidCast, 0xffffff);
        }
    }
    draw(drawer) {
        drawer.setTransform();
        const len = this._rays.length;
        for (let i = 0; i < len; i++) {
            const rayObj = this._rays[i];
            const ray = rayObj.ray;
            const ret = rayObj.ret;
            this._tempV2.x = rayObj.ray.origin.x + (ray.dir.x * (ret ? ret.toi : this._cfg.maxTOI));
            this._tempV2.y = rayObj.ray.origin.y + (ray.dir.y * (ret ? ret.toi : this._cfg.maxTOI));
            drawer.drawSegment(ray.origin, this._tempV2, 0x00ff00, 1);
            if (ret instanceof $A)
                drawer.drawArrow(this._tempV2.x, this._tempV2.y, ret.normal.x, ret.normal.y, .1, 0x00ff00, 1);
        }
    }
    destroy(context) {
        this._rays = [];
        this._bodies.forEach(b => {
            context.world.removeRigidBody(b);
        });
        this._bodies = [];
        clearTimeout(this._changeTimeout);
        this._debugBindings.forEach(b => {
            context.getDebugPane().remove(b);
        });
    }
}

class ShapeCast {
    _cfg = {
        numCast: 100,
        velocity: 10
    };
    _changeTimeout = NaN;
    _rays = [];
    _bodies = [];
    _center = CA.new(4, 4);
    _rayAngle = 0;
    _tempV2 = CA.new(0, 0);
    _capsule = null;
    _debugBindings = [];
    async init(context) {
        context.getDebugPane().disabled = true; // can't operate during loading json
        const json = await RUBELoader.loadJson('./json/test_raycast.json');
        const descs = RUBELoader.parseJsonToBodyDesc(json);
        descs.forEach(desc => {
            const body = context.world.createRigidBody(desc.desc);
            desc.colliders.forEach(c => {
                context.world.createCollider(c, body.handle);
            });
            this._bodies.push(body);
        });
        const numSlider = context.getDebugPane().addInput(this._cfg, 'numCast', { min: 10, max: 1000, step: 10 });
        numSlider.on('change', handler => {
            clearTimeout(this._changeTimeout);
            this._changeTimeout = window.setTimeout(() => {
                this._cfg.numCast = handler.value;
                this.genRays();
            }, 1000);
        });
        this._debugBindings.push(numSlider);
        const toiSlider = context.getDebugPane().addInput(this._cfg, 'velocity', { min: 1, max: 10, step: 1 });
        this._debugBindings.push(toiSlider);
        this._capsule = new xA(.7, .3);
        this.genRays();
        // enable after loading
        context.getDebugPane().disabled = false;
    }
    genRays() {
        if (this._rays.length === this._cfg.numCast)
            return;
        if (this._rays.length <= 0) {
            const num = this._cfg.numCast;
            for (let i = 0; i < num; i++) {
                this._rays.push({
                    ray: new _A(CA.zeros(), CA.new(1, 0)),
                    ret: null
                });
            }
        }
        else if (this._rays.length > this._cfg.numCast)
            this._rays.length = this._cfg.numCast;
        else if (this._rays.length < this._cfg.numCast) {
            const num = this._cfg.numCast - this._rays.length;
            for (let i = 0; i < num; i++) {
                this._rays.push({
                    ray: new _A(CA.zeros(), CA.new(1, 0)),
                    ret: null
                });
            }
        }
    }
    update(context, time, delta) {
        if (!this._capsule)
            return;
        this._rayAngle += 0.001;
        const len = this._rays.length;
        const step = Phaser.Math.DegToRad(360 / len);
        for (let i = 0; i < len; i++) {
            const rayObj = this._rays[i];
            rayObj.ray.origin.x = this._center.x;
            rayObj.ray.origin.y = this._center.y;
            rayObj.ray.dir.x = Math.cos(this._rayAngle + i * step);
            rayObj.ray.dir.y = Math.sin(this._rayAngle + i * step);
            rayObj.ret = context.world.castShape(rayObj.ray.origin, this._rayAngle, rayObj.ray.dir, this._capsule, this._cfg.velocity, 0xffffff);
        }
    }
    draw(drawer) {
        if (!this._capsule)
            return;
        const len = this._rays.length;
        for (let i = 0; i < len; i++) {
            drawer.setTransform(); // reset to 0,0
            const rayObj = this._rays[i];
            const ray = rayObj.ray;
            const ret = rayObj.ret;
            this._tempV2.x = rayObj.ray.origin.x + (ray.dir.x * (ret ? ret.toi : this._cfg.velocity));
            this._tempV2.y = rayObj.ray.origin.y + (ray.dir.y * (ret ? ret.toi : this._cfg.velocity));
            drawer.drawSegment(ray.origin, this._tempV2, 0x00ff00, 1);
            if (ret) {
                drawer.drawArrow(this._tempV2.x, this._tempV2.y, ret.normal1.x, ret.normal1.y, .1, 0xff0000, 1);
                drawer.drawArrow(this._tempV2.x, this._tempV2.y, ret.normal2.x, ret.normal2.y, .1, 0x0000ff, 1);
                drawer.setTransform(ret.witness1.x, ret.witness1.y);
                drawer.drawCircle(.03, 0x885500);
                this._tempV2.x = ret.witness2.x;
                this._tempV2.y = ret.witness2.y;
                const p = Phaser.Math.RotateAround(this._tempV2, 0, 0, this._rayAngle);
                drawer.setTransform(this._center.x + p.x, this._center.y + p.y);
                drawer.drawCircle(.03, 0x993300);
            }
        }
        drawer.setTransform(this._center.x, this._center.y, this._rayAngle);
        drawer.drawCapsule(this._capsule.halfHeight, this._capsule.radius, 0x003300, .9, 1);
    }
    destroy(context) {
        this._rays = [];
        this._bodies.forEach(b => {
            context.world.removeRigidBody(b);
        });
        this._bodies = [];
        clearTimeout(this._changeTimeout);
        this._debugBindings.forEach(b => {
            context.getDebugPane().remove(b);
        });
    }
}

