        pane.addMonitor(this._timeElapsed, 'physics', { label: 'Physics(ms)', view: 'text' });
        pane.addMonitor(this._timeElapsed, 'logic', { label: 'Logic(ms)', view: 'text' });
        pane.addMonitor(this._timeElapsed, 'drawing', { label: 'Drawing(ms)', view: 'text' });
        // @ts-ignore
